                    <section className = {cx("media")} data-aos="fade-right">
                        <article className = {cx("contentMedia")} >
                            <a href="https://github.com/0359689640Diep">
                                <i className="bi bi-github"></i>
                            </a>
                        </article>
                    </section>
                </section>
            </section>
            <section className = {cx("about")} id="about">
