                    <h1 data-aos="fade-up"
                    data-aos-duration="13000"> Project </h1>
                    <article className = {cx("titleProject")} data-aos="fade-up" data-aos-duration="13000">
                        <h2>Project</h2>
                    </article>
                    <section className = {cx("contentProject")}>
                        <section className = {cx("listContentProject")}>
